import axios from "axios";
import { useEffect } from "react";
type ItemType = {
    id: String;
    name: String;
    description: String;
    price: number;
    image: String;
};
const fetch = "http://localhost:8080/api/menu/getAllMenu";
const Items = () => {
    useEffect(() => {
        function displayItem(): any {
            axios.get("http://localhost:8080/api/menu/getAllMenu").then(
                (res) => {
                    res.data.map((item: ItemType) => {});
                },
                (err) => {
                    console.log(err);
                }
            );
        }
    }, []);

    return (
        <div>
            <h1>Items</h1>
            <div style={{ backgroundImage: `url($Items{image})` }}></div>
            <div>
                <h1>Items{"name"}</h1>
                <h3>Items{"description"}</h3>
                <p>Items{"price"}</p>
            </div>
        </div>
    );
};
export default Items;
